nDataSource"},"psf_tog":{"id":"e4b399cb-9927-4181-b35a-68871ff67eb5","type":"RadioButtonGroup"},"w":{"id":"81e902b0-afeb-47ac-8146-7c94c27a6d94","type":"ColumnDataSource"},"z_slid":{"id":"9ac4c275-dc92-4517-af51-e581c296ec7b","type":"Slider"}},"code":"function init(n) {\n    if (n !== 0 && (n & (n - 1)) === 0) {\n        _n = n;\n        _initArray();\n        _makeBitReversalTable();\n        _makeCosSinTable();\n    } else {\n        throw new Error('init: radix-2 required');\n    }\n}\n\nfunction flatten(array2D, nrows, ncols) {\n    var array1D = new Array(nrows * ncols);\n    for (var i = 0; i < nrows; i++){\n\tfor (var j = 0; j < ncols; j++){\n\t    array1D[j + ncols*i] = array2D[i][j];\n\t}\n    }\n    return array1D;\n}\n\nfunction deflatten(array1D, nrows, ncols) {\n    var array2D = new Array(nrows);\n    for (i = 0; i < nrows; i++) {\n        array2D[i] = new Array(ncols);\n        for (j = 0; j < ncols; j++) {\n             array2D[i][j]= array1D[j + ncols*i];\n        }\n    }\n    return array2D;\n} \n\n// 1D-FFT\nfunction fft1d(re, im) {\n    fft(re, im, 1);\n}\n\n// 1D-IFFT\nfunction ifft1d(re, im) {\n    var n = 1 / _n;\n    fft(re, im, -1);\n    for (var i = 0; i < _n; i++) {\n        re[i] *= n;\n        im[i] *= n;\n    }\n}\n\n// 1D-IFFT\nfunction bt(re, im) {\n    fft(re, im, -1);\n}\n\n// 2D-FFT Not very useful if the number of rows have to be equal to cols\nfunction fft2d(re, im) {\n    var tre = [],\n        tim = [],\n        i = 0;\n    // x-axis\n    for (var y = 0; y < _n; y++) {\n        i = y * _n;\n        for (var x1 = 0; x1 < _n; x1++) {\n            tre[x1] = re[x1 + i];\n            tim[x1] = im[x1 + i];\n        }\n        fft1d(tre, tim);\n        for (var x2 = 0; x2 < _n; x2++) {\n            re[x2 + i] = tre[x2];\n            im[x2 + i] = tim[x2];\n        }\n    }\n    // y-axis\n    for (var x = 0; x < _n; x++) {\n        for (var y1 = 0; y1 < _n; y1++) {\n            i = x + y1 * _n;\n            tre[y1] = re[i];\n            tim[y1] = im[i];\n        }\n        fft1d(tre, tim);\n        for (var y2 = 0; y2 < _n; y2++) {\n            i = x + y2 * _n;\n            re[i] = tre[y2];\n            im[i] = tim[y2];\n        }\n    }\n}\n\n// 2D-IFFT\nfunction ifft2d(re, im) {\n    var tre = [],\n        tim = [],\n        i = 0;\n    // x-axis\n    for (var y = 0; y < _n; y++) {\n        i = y * _n;\n        for (var x1 = 0; x1 < _n; x1++) {\n            tre[x1] = re[x1 + i];\n            tim[x1] = im[x1 + i];\n        }\n        ifft1d(tre, tim);\n        for (var x2 = 0; x2 < _n; x2++) {\n            re[x2 + i] = tre[x2];\n            im[x2 + i] = tim[x2];\n        }\n    }\n    // y-axis\n    for (var x = 0; x < _n; x++) {\n        for (var y1 = 0; y1 < _n; y1++) {\n            i = x + y1 * _n;\n            tre[y1] = re[i];\n            tim[y1] = im[i];\n        }\n        ifft1d(tre, tim);\n        for (var y2 = 0; y2 < _n; y2++) {\n            i = x + y2 * _n;\n            re[i] = tre[y2];\n            im[i] = tim[y2];\n        }\n    }\n}\n\n// core operation of FFT\nfunction fft(re, im, inv) {\n    var d, h, ik, m, tmp, wr, wi, xr, xi,\n        n4 = _n >> 2;\n    // bit reversal\n    for (var l = 0; l < _n; l++) {\n        m = _bitrev[l];\n        if (l < m) {\n            tmp = re[l];\n            re[l] = re[m];\n            re[m] = tmp;\n            tmp = im[l];\n            im[l] = im[m];\n            im[m] = tmp;\n        }\n    }\n    // butterfly operation\n    for (var k = 1; k < _n; k <<= 1) {\n        h = 0;\n        d = _n / (k << 1);\n        for (var j = 0; j < k; j++) {\n            wr = _cstb[h + n4];\n            wi = inv * _cstb[h];\n            for (var i = j; i < _n; i += (k << 1)) {\n                ik = i + k;\n                xr = wr * re[ik] + wi * im[ik];\n                xi = wr * im[ik] - wi * re[ik];\n                re[ik] = re[i] - xr;\n                re[i] += xr;\n                im[ik] = im[i] - xi;\n                im[i] += xi;\n            }\n            h += d;\n        }\n    }\n}\n\n// initialize the array (supports TypedArray)\nfunction _initArray() {\n    if (typeof Uint32Array !== 'undefined') {\n        _bitrev = new Uint32Array(_n);\n    } else {\n        _bitrev = [];\n    }\n    if (typeof Float64Array !== 'undefined') {\n        _cstb = new Float64Array(_n * 1.25);\n    } else {\n        _cstb = [];\n    }\n}\n\n//function _paddingZero() {\n//    // TODO\n//}\n\nfunction _makeBitReversalTable() {\n    var i = 0,\n        j = 0,\n        k = 0;\n    _bitrev[0] = 0;\n    while (++i < _n) {\n        k = _n >> 1;\n        while (k <= j) {\n            j -= k;\n            k >>= 1;\n        }\n        j += k;\n        _bitrev[i] = j;\n    }\n}\n\n// makes trigonometric function table\nfunction _makeCosSinTable() {\n    var n2 = _n >> 1,\n        n4 = _n >> 2,\n        n8 = _n >> 3,\n        n2p4 = n2 + n4,\n        t = Math.sin(Math.PI / _n),\n        dc = 2 * t * t,\n        ds = Math.sqrt(dc * (2 - dc)),\n        c = _cstb[n4] = 1,\n        s = _cstb[0] = 0;\n    t = 2 * dc;\n    for (var i = 1; i < n8; i++) {\n        c -= dc;\n        dc += t * c;\n        s += ds;\n        ds -= t * s;\n        _cstb[i] = s;\n        _cstb[n4 - i] = c;\n    }\n    if (n8 !== 0) {\n        _cstb[n8] = Math.sqrt(0.5);\n    }\n    for (var j = 0; j < n4; j++) {\n        _cstb[n2 - j] = _cstb[j];\n    }\n    for (var k = 0; k < n2p4; k++) {\n        _cstb[k + n2] = -_cstb[k];\n    }\n}\nfunction reconstructTwoRealFFT(fourierTransform, realTransform1, realTransform2) {\n    var length = fourierTransform.re.length;\n\n    // the components n=0 are trivial\n    realTransform1.re[0] = fourierTransform.re[0];\n    realTransform1.im[0] = 0.0;\n    realTransform2.re[0] = fourierTransform.im[0];\n    realTransform2.im[0] = 0.0;\n    var rm, rp, im, ip, j;\n    for (var i = length / 2; i > 0; i--) {\n        j = length - i;\n        rm = 0.5 * (fourierTransform.re[i] - fourierTransform.re[j]);\n        rp = 0.5 * (fourierTransform.re[i] + fourierTransform.re[j]);\n        im = 0.5 * (fourierTransform.im[i] - fourierTransform.im[j]);\n        ip = 0.5 * (fourierTransform.im[i] + fourierTransform.im[j]);\n        realTransform1.re[i] = rp;\n        realTransform1.im[i] = im;\n        realTransform1.re[j] = rp;\n        realTransform1.im[j] = -im;\n        realTransform2.re[i] = ip;\n        realTransform2.im[i] = -rm;\n        realTransform2.re[j] = ip;\n        realTransform2.im[j] = rm;\n    }\n}\nfunction ifft2DArray(ft, ftRows, ftCols) {\n    var tempTransform = new Array(ftRows * ftCols);\n    var nRows = ftRows / 2;\n    var nCols = (ftCols - 1) * 2;\n    // reverse transform columns\n    init(nRows);\n    var tmpCols = {re: new Array(nRows), im: new Array(nRows)};\n    var iRow, iCol;\n    for (iCol = 0; iCol < ftCols; iCol++) {\n        for (iRow = nRows - 1; iRow >= 0; iRow--) {\n            tmpCols.re[iRow] = ft[(iRow * 2) * ftCols + iCol];\n            tmpCols.im[iRow] = ft[(iRow * 2 + 1) * ftCols + iCol];\n        }\n        //Unnormalized inverse transform\n        bt(tmpCols.re, tmpCols.im);\n        for (iRow = nRows - 1; iRow >= 0; iRow--) {\n            tempTransform[(iRow * 2) * ftCols + iCol] = tmpCols.re[iRow];\n            tempTransform[(iRow * 2 + 1) * ftCols + iCol] = tmpCols.im[iRow];\n        }\n    }\n\n    // reverse row transform\n    var finalTransform = new Array(nRows * nCols);\n    init(nCols);\n    var tmpRows = {re: new Array(nCols), im: new Array(nCols)};\n    var scale = nCols * nRows;\n    for (iRow = 0; iRow < ftRows; iRow += 2) {\n        tmpRows.re[0] = tempTransform[iRow * ftCols];\n        tmpRows.im[0] = tempTransform[(iRow + 1) * ftCols];\n        for (iCol = 1; iCol < ftCols; iCol++) {\n            tmpRows.re[iCol] = tempTransform[iRow * ftCols + iCol];\n            tmpRows.im[iCol] = tempTransform[(iRow + 1) * ftCols + iCol];\n            tmpRows.re[nCols - iCol] = tempTransform[iRow * ftCols + iCol];\n            tmpRows.im[nCols - iCol] = -tempTransform[(iRow + 1) * ftCols + iCol];\n        }\n        //Unnormalized inverse transform\n        bt(tmpRows.re, tmpRows.im);\n\n        var indexB = (iRow / 2) * nCols;\n        for (iCol = nCols - 1; iCol >= 0; iCol--) {\n            finalTransform[indexB + iCol] = tmpRows.re[iCol] / scale;\n        }\n    }\n    return finalTransform;\n}\nfunction fft2DArray(data, nRows, nCols) {\n    var iRow, iCol;\n    var ftCols = (nCols / 2 + 1);\n    var ftRows = nRows * 2;\n    var tempTransform = new Array(ftRows * ftCols);\n    init(nCols);\n    // transform rows\n    var tmpRows = {re: new Array(nCols), im: new Array(nCols)};\n    var row1 = {re: new Array(nCols), im: new Array(nCols)};\n    var row2 = {re: new Array(nCols), im: new Array(nCols)};\n    var index, iRow0, iRow1, iRow2, iRow3;\n    for (iRow = 0; iRow < nRows / 2; iRow++) {\n        index = (iRow * 2) * nCols;\n        tmpRows.re = data.slice(index, index + nCols);\n\n        index = (iRow * 2 + 1) * nCols;\n        tmpRows.im = data.slice(index, index + nCols);\n\n        fft1d(tmpRows.re, tmpRows.im);\n\n        reconstructTwoRealFFT(tmpRows, row1, row2);\n        //Now lets put back the result into the output array\n        iRow0 = (iRow * 4) * ftCols;\n        iRow1 = (iRow * 4 + 1) * ftCols;\n        iRow2 = (iRow * 4 + 2) * ftCols;\n        iRow3 = (iRow * 4 + 3) * ftCols;\n        for (var k = ftCols - 1; k >= 0; k--) {\n            tempTransform[iRow0 + k] = row1.re[k];\n            tempTransform[iRow1 + k] = row1.im[k];\n            tempTransform[iRow2 + k] = row2.re[k];\n            tempTransform[iRow3 + k] = row2.im[k];\n        }\n    }\n\n    row1 = null;\n    row2 = null;\n    // transform columns\n    var finalTransform = new Array(ftRows * ftCols);\n\n    init(nRows);\n    var tmpCols = {re: new Array(nRows), im: new Array(nRows)};\n    for (iCol = ftCols - 1; iCol >= 0; iCol--) {\n        for (iRow = nRows - 1; iRow >= 0; iRow--) {\n            tmpCols.re[iRow] = tempTransform[(iRow * 2) * ftCols + iCol];\n            tmpCols.im[iRow] = tempTransform[(iRow * 2 + 1) * ftCols + iCol];\n            //TODO Check why this happens\n            if (isNaN(tmpCols.re[iRow])) {\n                tmpCols.re[iRow] = 0;\n            }\n            if (isNaN(tmpCols.im[iRow])) {\n                tmpCols.im[iRow] = 0;\n            }\n        }\n        fft1d(tmpCols.re, tmpCols.im);\n        for (iRow = nRows - 1; iRow >= 0; iRow--) {\n            finalTransform[(iRow * 2) * ftCols + iCol] = tmpCols.re[iRow];\n            finalTransform[(iRow * 2 + 1) * ftCols + iCol] = tmpCols.im[iRow];\n        }\n    }\n    return finalTransform;\n}\nfunction convolute2DI(ftSignal, ftFilter, ftRows, ftCols) {\n    var re, im;\n    for (var iRow = 0; iRow < ftRows / 2; iRow++) {\n        for (var iCol = 0; iCol < ftCols; iCol++) {\n            //\n            re = ftSignal[(iRow * 2) * ftCols + iCol]\n                * ftFilter[(iRow * 2) * ftCols + iCol]\n                - ftSignal[(iRow * 2 + 1) * ftCols + iCol]\n                * ftFilter[(iRow * 2 + 1) * ftCols + iCol];\n            im = ftSignal[(iRow * 2) * ftCols + iCol]\n                * ftFilter[(iRow * 2 + 1) * ftCols + iCol]\n                + ftSignal[(iRow * 2 + 1) * ftCols + iCol]\n                * ftFilter[(iRow * 2) * ftCols + iCol];\n            //\n            ftSignal[(iRow * 2) * ftCols + iCol] = re;\n            ftSignal[(iRow * 2 + 1) * ftCols + iCol] = im;\n        }\n    }\n}\n\nfunction convolute(data, kernel, nRows, nCols) {\n    var i, j;\n    var ftSpectrum = new Array(nCols * nRows);\n    var im_flat = new Array(nCols * nRows);\n    for (i = 0; i < nRows * nCols; i++) {\n        ftSpectrum[i] = data[i];\n    }\n\n    ftSpectrum = fft2DArray(ftSpectrum, nRows, nCols);\n\n    var dimR = kernel.length;\n    var dimC = kernel[0].length;\n    var ftFilterData = new Array(nCols * nRows);\n    for (i = 0; i < nCols * nRows; i++) {\n        ftFilterData[i] = 0;\n    }\n\n    var iRow, iCol;\n    var shiftR = Math.floor((dimR - 1) / 2);\n    var shiftC = Math.floor((dimC - 1) / 2);\n    for (var ir = 0; ir < dimR; ir++) {\n        iRow = (ir - shiftR + nRows) % nRows;\n        for (var ic = 0; ic < dimC; ic++) {\n            iCol = (ic - shiftC + nCols) % nCols;\n            ftFilterData[iRow * nCols + iCol] = kernel[ir][ic];\n        }\n    }\n    ftFilterData = fft2DArray(ftFilterData, nRows, nCols);\n\n    var ftRows = nRows * 2;\n    var ftCols = nCols / 2 + 1;\n    convolute2DI(ftSpectrum, ftFilterData, ftRows, ftCols);\n\n    return ifft2DArray(ftSpectrum, ftRows, ftCols);\n}\n\nfunction my_convolve(image_flat, kernel, nRows, nCols) {\n    var kn = Math.sqrt(kernel.length);\n    var kernel_2D = deflatten(kernel, kn, kn);\n\n    return convolute(image_flat, kernel_2D, nRows, nCols);\n}\n\nfunction rnorm_int(mean, stdev) {\n    var u1, u2, v1, v2, s;\n    if (mean === undefined) {\n\tmean = 0.0;\n    }\n    if (stdev === undefined) {\n\tstdev = 1.0;\n    }\n    do {\n\tu1 = Math.random();\n\tu2 = Math.random();\n\tv1 = 2 * u1 - 1;\n\tv2 = 2 * u2 - 1;\n\ts = v1 * v1 + v2 * v2;\n    } while (s === 0 || s >= 1);\n    v2 = v2 * Math.sqrt(-2 * Math.log(s) / s);\n    \n    var result = Math.round(stdev * v1 * Math.sqrt(-2 * Math.log(s) / s) + mean);\n    return result;\n}\n\n// Generate Poisson distributed random numbers\nfunction rpoisson(lambda) {\n    if (lambda === undefined) {\n\tlambda = 1;\n    }\n    var l = Math.exp(-lambda),\n\tk = 0,\n\tp = 1.0;\n    do {\n\tk++;\n\tp *= Math.random();\n    } while (p > l);\n    return k - 1;\n}\n\n// Vectorize a random generator\nfunction vectorize(generator) {\n    return function () {\n\tvar n, result, i, args;\n\targs = [].slice.call(arguments)\n\tn = args.shift();\n\tresult = [];\n\tfor (i = 0; i < n; i++) {\n\t    result.push(generator.apply(this, args));\n\t}\n\treturn result;\n    };\n}\n\nvar rvnorm = vectorize(rnorm_int);\nvar rvpoisson = vectorize(rpoisson);\n\nfunction draw_stars(num, mean_rate) {\n    if (mean_rat nDataSource"},"psf_tog":{"id":"e4b399cb-9927-4181-b35a-68871ff67eb5","type":"RadioButtonGroup"},"w":{"id":"81e902b0-afeb-47ac-8146-7c94c27a6d94","type":"ColumnDataSource"},"z_slid":{"id":"9ac4c275-dc92-4517-af51-e581c296ec7b","type":"Slider"}},"code":"function init(n) {\n    if (n !== 0 && (n & (n - 1)) === 0) {\n        _n = n;\n        _initArray();\n        _makeBitReversalTable();\n        _makeCosSinTable();\n    } else {\n        throw new Error('init: radix-2 required');\n    }\n}\n\nfunction flatten(array2D, nrows, ncols) {\n    var array1D = new Array(nrows * ncols);\n    for (var i = 0; i < nrows; i++){\n\tfor (var j = 0; j < ncols; j++){\n\t    array1D[j + ncols*i] = array2D[i][j];\n\t}\n    }\n    return array1D;\n}\n\nfunction deflatten(array1D, nrows, ncols) {\n    var array2D = new Array(nrows);\n    for (i = 0; i < nrows; i++) {\n        array2D[i] = new Array(ncols);\n        for (j = 0; j < ncols; j++) {\n             array2D[i][j]= array1D[j + ncols*i];\n        }\n    }\n    return array2D;\n} \n\n// 1D-FFT\nfunction fft1d(re, im) {\n    fft(re, im, 1);\n}\n\n// 1D-IFFT\nfunction ifft1d(re, im) {\n    var n = 1 / _n;\n    fft(re, im, -1);\n    for (var i = 0; i < _n; i++) {\n        re[i] *= n;\n        im[i] *= n;\n    }\n}\n\n// 1D-IFFT\nfunction bt(re, im) {\n    fft(re, im, -1);\n}\n\n// 2D-FFT Not very useful if the number of rows have to be equal to cols\nfunction fft2d(re, im) {\n    var tre = [],\n        tim = [],\n        i = 0;\n    // x-axis\n    for (var y = 0; y < _n; y++) {\n        i = y * _n;\n        for (var x1 = 0; x1 < _n; x1++) {\n            tre[x1] = re[x1 + i];\n            tim[x1] = im[x1 + i];\n        }\n        fft1d(tre, tim);\n        for (var x2 = 0; x2 < _n; x2++) {\n            re[x2 + i] = tre[x2];\n            im[x2 + i] = tim[x2];\n        }\n    }\n    // y-axis\n    for (var x = 0; x < _n; x++) {\n        for (var y1 = 0; y1 < _n; y1++) {\n            i = x + y1 * _n;\n            tre[y1] = re[i];\n            tim[y1] = im[i];\n        }\n        fft1d(tre, tim);\n        for (var y2 = 0; y2 < _n; y2++) {\n            i = x + y2 * _n;\n            re[i] = tre[y2];\n            im[i] = tim[y2];\n        }\n    }\n}\n\n// 2D-IFFT\nfunction ifft2d(re, im) {\n    var tre = [],\n        tim = [],\n        i = 0;\n    // x-axis\n    for (var y = 0; y < _n; y++) {\n        i = y * _n;\n        for (var x1 = 0; x1 < _n; x1++) {\n            tre[x1] = re[x1 + i];\n            tim[x1] = im[x1 + i];\n        }\n        ifft1d(tre, tim);\n        for (var x2 = 0; x2 < _n; x2++) {\n            re[x2 + i] = tre[x2];\n            im[x2 + i] = tim[x2];\n        }\n    }\n    // y-axis\n    for (var x = 0; x < _n; x++) {\n        for (var y1 = 0; y1 < _n; y1++) {\n            i = x + y1 * _n;\n            tre[y1] = re[i];\n            tim[y1] = im[i];\n        }\n        ifft1d(tre, tim);\n        for (var y2 = 0; y2 < _n; y2++) {\n            i = x + y2 * _n;\n            re[i] = tre[y2];\n            im[i] = tim[y2];\n        }\n    }\n}\n\n// core operation of FFT\nfunction fft(re, im, inv) {\n    var d, h, ik, m, tmp, wr, wi, xr, xi,\n        n4 = _n >> 2;\n    // bit reversal\n    for (var l = 0; l < _n; l++) {\n        m = _bitrev[l];\n        if (l < m) {\n            tmp = re[l];\n            re[l] = re[m];\n            re[m] = tmp;\n            tmp = im[l];\n            im[l] = im[m];\n            im[m] = tmp;\n        }\n    }\n    // butterfly operation\n    for (var k = 1; k < _n; k <<= 1) {\n        h = 0;\n        d = _n / (k << 1);\n        for (var j = 0; j < k; j++) {\n            wr = _cstb[h + n4];\n            wi = inv * _cstb[h];\n            for (var i = j; i < _n; i += (k << 1)) {\n                ik = i + k;\n                xr = wr * re[ik] + wi * im[ik];\n                xi = wr * im[ik] - wi * re[ik];\n                re[ik] = re[i] - xr;\n                re[i] += xr;\n                im[ik] = im[i] - xi;\n                im[i] += xi;\n            }\n            h += d;\n        }\n    }\n}\n\n// initialize the array (supports TypedArray)\nfunction _initArray() {\n    if (typeof Uint32Array !== 'undefined') {\n        _bitrev = new Uint32Array(_n);\n    } else {\n        _bitrev = [];\n    }\n    if (typeof Float64Array !== 'undefined') {\n        _cstb = new Float64Array(_n * 1.25);\n    } else {\n        _cstb = [];\n    }\n}\n\n//function _paddingZero() {\n//    // TODO\n//}\n\nfunction _makeBitReversalTable() {\n    var i = 0,\n        j = 0,\n        k = 0;\n    _bitrev[0] = 0;\n    while (++i < _n) {\n        k = _n >> 1;\n        while (k <= j) {\n            j -= k;\n            k >>= 1;\n        }\n        j += k;\n        _bitrev[i] = j;\n    }\n}\n\n// makes trigonometric function table\nfunction _makeCosSinTable() {\n    var n2 = _n >> 1,\n        n4 = _n >> 2,\n        n8 = _n >> 3,\n        n2p4 = n2 + n4,\n        t = Math.sin(Math.PI / _n),\n        dc = 2 * t * t,\n        ds = Math.sqrt(dc * (2 - dc)),\n        c = _cstb[n4] = 1,\n        s = _cstb[0] = 0;\n    t = 2 * dc;\n    for (var i = 1; i < n8; i++) {\n        c -= dc;\n        dc += t * c;\n        s += ds;\n        ds -= t * s;\n        _cstb[i] = s;\n        _cstb[n4 - i] = c;\n    }\n    if (n8 !== 0) {\n        _cstb[n8] = Math.sqrt(0.5);\n    }\n    for (var j = 0; j < n4; j++) {\n        _cstb[n2 - j] = _cstb[j];\n    }\n    for (var k = 0; k < n2p4; k++) {\n        _cstb[k + n2] = -_cstb[k];\n    }\n}\nfunction reconstructTwoRealFFT(fourierTransform, realTransform1, realTransform2) {\n    var length = fourierTransform.re.length;\n\n    // the components n=0 are trivial\n    realTransform1.re[0] = fourierTransform.re[0];\n    realTransform1.im[0] = 0.0;\n    realTransform2.re[0] = fourierTransform.im[0];\n    realTransform2.im[0] = 0.0;\n    var rm, rp, im, ip, j;\n    for (var i = length / 2; i > 0; i--) {\n        j = length - i;\n        rm = 0.5 * (fourierTransform.re[i] - fourierTransform.re[j]);\n        rp = 0.5 * (fourierTransform.re[i] + fourierTransform.re[j]);\n        im = 0.5 * (fourierTransform.im[i] - fourierTransform.im[j]);\n        ip = 0.5 * (fourierTransform.im[i] + fourierTransform.im[j]);\n        realTransform1.re[i] = rp;\n        realTransform1.im[i] = im;\n        realTransform1.re[j] = rp;\n        realTransform1.im[j] = -im;\n        realTransform2.re[i] = ip;\n        realTransform2.im[i] = -rm;\n        realTransform2.re[j] = ip;\n        realTransform2.im[j] = rm;\n    }\n}\nfunction ifft2DArray(ft, ftRows, ftCols) {\n    var tempTransform = new Array(ftRows * ftCols);\n    var nRows = ftRows / 2;\n    var nCols = (ftCols - 1) * 2;\n    // reverse transform columns\n    init(nRows);\n    var tmpCols = {re: new Array(nRows), im: new Array(nRows)};\n    var iRow, iCol;\n    for (iCol = 0; iCol < ftCols; iCol++) {\n        for (iRow = nRows - 1; iRow >= 0; iRow--) {\n            tmpCols.re[iRow] = ft[(iRow * 2) * ftCols + iCol];\n            tmpCols.im[iRow] = ft[(iRow * 2 + 1) * ftCols + iCol];\n        }\n        //Unnormalized inverse transform\n        bt(tmpCols.re, tmpCols.im);\n        for (iRow = nRows - 1; iRow >= 0; iRow--) {\n            tempTransform[(iRow * 2) * ftCols + iCol] = tmpCols.re[iRow];\n            tempTransform[(iRow * 2 + 1) * ftCols + iCol] = tmpCols.im[iRow];\n        }\n    }\n\n    // reverse row transform\n    var finalTransform = new Array(nRows * nCols);\n    init(nCols);\n    var tmpRows = {re: new Array(nCols), im: new Array(nCols)};\n    var scale = nCols * nRows;\n    for (iRow = 0; iRow < ftRows; iRow += 2) {\n        tmpRows.re[0] = tempTransform[iRow * ftCols];\n        tmpRows.im[0] = tempTransform[(iRow + 1) * ftCols];\n        for (iCol = 1; iCol < ftCols; iCol++) {\n            tmpRows.re[iCol] = tempTransform[iRow * ftCols + iCol];\n            tmpRows.im[iCol] = tempTransform[(iRow + 1) * ftCols + iCol];\n            tmpRows.re[nCols - iCol] = tempTransform[iRow * ftCols + iCol];\n            tmpRows.im[nCols - iCol] = -tempTransform[(iRow + 1) * ftCols + iCol];\n        }\n        //Unnormalized inverse transform\n        bt(tmpRows.re, tmpRows.im);\n\n        var indexB = (iRow / 2) * nCols;\n        for (iCol = nCols - 1; iCol >= 0; iCol--) {\n            finalTransform[indexB + iCol] = tmpRows.re[iCol] / scale;\n        }\n    }\n    return finalTransform;\n}\nfunction fft2DArray(data, nRows, nCols) {\n    var iRow, iCol;\n    var ftCols = (nCols / 2 + 1);\n    var ftRows = nRows * 2;\n    var tempTransform = new Array(ftRows * ftCols);\n    init(nCols);\n    // transform rows\n    var tmpRows = {re: new Array(nCols), im: new Array(nCols)};\n    var row1 = {re: new Array(nCols), im: new Array(nCols)};\n    var row2 = {re: new Array(nCols), im: new Array(nCols)};\n    var index, iRow0, iRow1, iRow2, iRow3;\n    for (iRow = 0; iRow < nRows / 2; iRow++) {\n        index = (iRow * 2) * nCols;\n        tmpRows.re = data.slice(index, index + nCols);\n\n        index = (iRow * 2 + 1) * nCols;\n        tmpRows.im = data.slice(index, index + nCols);\n\n        fft1d(tmpRows.re, tmpRows.im);\n\n        reconstructTwoRealFFT(tmpRows, row1, row2);\n        //Now lets put back the result into the output array\n        iRow0 = (iRow * 4) * ftCols;\n        iRow1 = (iRow * 4 + 1) * ftCols;\n        iRow2 = (iRow * 4 + 2) * ftCols;\n        iRow3 = (iRow * 4 + 3) * ftCols;\n        for (var k = ftCols - 1; k >= 0; k--) {\n            tempTransform[iRow0 + k] = row1.re[k];\n            tempTransform[iRow1 + k] = row1.im[k];\n            tempTransform[iRow2 + k] = row2.re[k];\n            tempTransform[iRow3 + k] = row2.im[k];\n        }\n    }\n\n    row1 = null;\n    row2 = null;\n    // transform columns\n    var finalTransform = new Array(ftRows * ftCols);\n\n    init(nRows);\n    var tmpCols = {re: new Array(nRows), im: new Array(nRows)};\n    for (iCol = ftCols - 1; iCol >= 0; iCol--) {\n        for (iRow = nRows - 1; iRow >= 0; iRow--) {\n            tmpCols.re[iRow] = tempTransform[(iRow * 2) * ftCols + iCol];\n            tmpCols.im[iRow] = tempTransform[(iRow * 2 + 1) * ftCols + iCol];\n            //TODO Check why this happens\n            if (isNaN(tmpCols.re[iRow])) {\n                tmpCols.re[iRow] = 0;\n            }\n            if (isNaN(tmpCols.im[iRow])) {\n                tmpCols.im[iRow] = 0;\n            }\n        }\n        fft1d(tmpCols.re, tmpCols.im);\n        for (iRow = nRows - 1; iRow >= 0; iRow--) {\n            finalTransform[(iRow * 2) * ftCols + iCol] = tmpCols.re[iRow];\n            finalTransform[(iRow * 2 + 1) * ftCols + iCol] = tmpCols.im[iRow];\n        }\n    }\n    return finalTransform;\n}\nfunction convolute2DI(ftSignal, ftFilter, ftRows, ftCols) {\n    var re, im;\n    for (var iRow = 0; iRow < ftRows / 2; iRow++) {\n        for (var iCol = 0; iCol < ftCols; iCol++) {\n            //\n            re = ftSignal[(iRow * 2) * ftCols + iCol]\n                * ftFilter[(iRow * 2) * ftCols + iCol]\n                - ftSignal[(iRow * 2 + 1) * ftCols + iCol]\n                * ftFilter[(iRow * 2 + 1) * ftCols + iCol];\n            im = ftSignal[(iRow * 2) * ftCols + iCol]\n                * ftFilter[(iRow * 2 + 1) * ftCols + iCol]\n                + ftSignal[(iRow * 2 + 1) * ftCols + iCol]\n                * ftFilter[(iRow * 2) * ftCols + iCol];\n            //\n            ftSignal[(iRow * 2) * ftCols + iCol] = re;\n            ftSignal[(iRow * 2 + 1) * ftCols + iCol] = im;\n        }\n    }\n}\n\nfunction convolute(data, kernel, nRows, nCols) {\n    var i, j;\n    var ftSpectrum = new Array(nCols * nRows);\n    var im_flat = new Array(nCols * nRows);\n    for (i = 0; i < nRows * nCols; i++) {\n        ftSpectrum[i] = data[i];\n    }\n\n    ftSpectrum = fft2DArray(ftSpectrum, nRows, nCols);\n\n    var dimR = kernel.length;\n    var dimC = kernel[0].length;\n    var ftFilterData = new Array(nCols * nRows);\n    for (i = 0; i < nCols * nRows; i++) {\n        ftFilterData[i] = 0;\n    }\n\n    var iRow, iCol;\n    var shiftR = Math.floor((dimR - 1) / 2);\n    var shiftC = Math.floor((dimC - 1) / 2);\n    for (var ir = 0; ir < dimR; ir++) {\n        iRow = (ir - shiftR + nRows) % nRows;\n        for (var ic = 0; ic < dimC; ic++) {\n            iCol = (ic - shiftC + nCols) % nCols;\n            ftFilterData[iRow * nCols + iCol] = kernel[ir][ic];\n        }\n    }\n    ftFilterData = fft2DArray(ftFilterData, nRows, nCols);\n\n    var ftRows = nRows * 2;\n    var ftCols = nCols / 2 + 1;\n    convolute2DI(ftSpectrum, ftFilterData, ftRows, ftCols);\n\n    return ifft2DArray(ftSpectrum, ftRows, ftCols);\n}\n\nfunction my_convolve(image_flat, kernel, nRows, nCols) {\n    var kn = Math.sqrt(kernel.length);\n    var kernel_2D = deflatten(kernel, kn, kn);\n\n    return convolute(image_flat, kernel_2D, nRows, nCols);\n}\n\nfunction rnorm_int(mean, stdev) {\n    var u1, u2, v1, v2, s;\n    if (mean === undefined) {\n\tmean = 0.0;\n    }\n    if (stdev === undefined) {\n\tstdev = 1.0;\n    }\n    do {\n\tu1 = Math.random();\n\tu2 = Math.random();\n\tv1 = 2 * u1 - 1;\n\tv2 = 2 * u2 - 1;\n\ts = v1 * v1 + v2 * v2;\n    } while (s === 0 || s >= 1);\n    v2 = v2 * Math.sqrt(-2 * Math.log(s) / s);\n    \n    var result = Math.round(stdev * v1 * Math.sqrt(-2 * Math.log(s) / s) + mean);\n    return result;\n}\n\n// Generate Poisson distributed random numbers\nfunction rpoisson(lambda) {\n    if (lambda === undefined) {\n\tlambda = 1;\n    }\n    var l = Math.exp(-lambda),\n\tk = 0,\n\tp = 1.0;\n    do {\n\tk++;\n\tp *= Math.random();\n    } while (p > l);\n    return k - 1;\n}\n\n// Vectorize a random generator\nfunction vectorize(generator) {\n    return function () {\n\tvar n, result, i, args;\n\targs = [].slice.call(arguments)\n\tn = args.shift();\n\tresult = [];\n\tfor (i = 0; i < n; i++) {\n\t    result.push(generator.apply(this, args));\n\t}\n\treturn result;\n    };\n}\n\nvar rvnorm = vectorize(rnorm_int);\nvar rvpoisson = vectorize(rpoisson);\n\nfunction draw_stars(num, mean_rate) {\n    if (mean_rate < 100) {\n\treturn rvpoisson(num, mean_rate);\n    }\n    else if (mean_rate < 10000) {\n\treturn rvnorm(num, mean_rate, Math.sqrt(mean_rate));\n    }\n    else {\n\tvar result = new Array(num);\n\tfor (var i = 0; i < num; i++){\n\t    result[i] = Math.round(mean_rate);\n\t}\n\treturn result;\n    }\n}\nfunction draw_images(Npix, Nscale, fluxes1, fluxes2, weights) {\n    var num_pixels = Nscale * Nscale\n    var im1 = new Array(num_pixels);\n    var im2 = new Array(num_pixels);\n    var num_bins = weights.length;\n\n    for (var p = 0; p < num_pixels; p++){\n\tim1[p] = 0.;\n\tim2[p] = 0.;\n    }\n    \n    for (var i = 0; i < num_bins; i++) {\n\t/* draw stars for each pixel */\n\tvar num_stars = draw_stars(num_pixels, Npix * weights[i]);\n\t/* add flux to each pixel in two images*/\n\tfor (var p = 0; p < num_pixels; p++){\n\t    im1[p] = im1[p] + fluxes1[i] * num_stars[p];\n\t    im2[p] = im2[p] + fluxes2[i] * num_stars[p];\n\t}\n    }\n    return [im1, im2];\n}\n\nfunction flux_to_mag(fluxes, reddening, exposure, zpt, dmod){\n    var num_pixels = fluxes.length;\n    var result = new Array(num_pixels);\n    for (var i = 0; i < num_pixels; i++) {\n\tresult[i] = zpt - dmod + reddening - (2.5*Math.log10(fluxes[i] / exposure))\n    }\n    return result;\n}\n\nfunction bin_2d(x, y, xbins, ybins){\n    console.log('testing');\n    var nx = xbins.length;\n    var ny = ybins.length;\n    var n = x.length;\n    var result = new Array(nx-1);\n    for (var i = 0; i < nx-1; i++){\n\tresult[i] = new Array(ny-1);\n\tfor (var j = 0; j < ny-1; j++){\n\t    result[i][j] = 0;\n\t}\n    }\n\n    for (var d = 0; d < n; d++) {\n\tif (x[d] < xbins[0] || x[d] > xbins[nx-1] || y[d] < ybins[0] || y[d] > ybins[ny-1]){\n\t    continue;\n\t}\n\tvar i = 0;\n\tvar j = 0;\n\twhile (true) {\n\t    if (xbins[i] <= x[d] && x[d] < xbins[i+1]){\n\t\tbreak;\n\t    }\n\t    i++;\n\t}\n\twhile (true) {\n\t    if (ybins[i] <= y[d] && y[d] < ybins[i+1]){\n\t\tbreak\n\t    }\n\t    j++;\n\t}\n\tresult[i][
